import {
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
  IonButton,
  IonMenuButton,
  IonList,
  IonItem,
  IonLabel,
  IonToggle,
} from "@ionic/react";
import React from "react";

import { COURSE_DATA } from './Courses';

const Filter: React.FC = () => {
  const filterChangeHandler = (event: CustomEvent) => {
    console.log(event);
  };

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButton slot="start">
            <IonMenuButton />
          </IonButton>
          <IonTitle>Filter</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <IonList>
          {COURSE_DATA.map(course => (
            <IonItem>
              <IonLabel>
                {course.title}
              </IonLabel>
              <IonToggle value={course.id} onIonChange={filterChangeHandler} />
            </IonItem>
          ))}
        </IonList>
      </IonContent>
    </IonPage>
  );
};

export default Filter;
